import React from 'react';
import Card from '../UI/Card';
import classes from './AvailableMeals.module.css';
import MealItem from './MealItem/MealItem';
const DUMMY_MEALS = [
  {
    id: 'm1',
    foodName: 'Chicken Katta Special',
    foodDescription:
      'Chicken Fry + Chicken Masala + Egg Wati + Tambda & Pandhara Rassa + Choice Of Chapatis (3)/ Bhakri (2) + Biryani.',
    foodPrice: 360.0,
  },
  {
    id: 'm2',
    name: 'Chicken Rasa Thali',
    description:
      'Rassa Chicken + Tambda & Pandhara Rassa + Choice Of Chapatis (3)/ Bhakri (2) + Biryani Rice + 1 Wati Dahikanda.',
    price: 260.0,
  },
  {
    id: 'm3',
    name: 'Egg Thali',
    description:
      'Egg Masala + Tambada Rassa + Pandhara Rassa + Choice Of Chapatis (3)/ Bhakri (2) + Rice + 1 Wati Dahikanda.',
    price: 150.0,
  },
  {
    id: 'm4',
    name: 'Chicken Biryani+Chicken Fry',
    description:
      'Briyani with Special indrigents and western style fried chicken',
    price: 450.0,
  },
];

const AvailableMeals = () => {
  const mealslist = DUMMY_MEALS.map((meal) => (
    <MealItem
      key={meal.id}
      foodName={meal.foodName}
      foodDescription={meal.foodDescription}
      foodPrice={meal.foodPrice}
    />
  ));
  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealslist}</ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
